 come along for good beer, good company and what\'s sure to be the highlight of the SU calendar!<br><br>For more information on any aspect of the festival visit our website: www.warwickale.co.uk<br><br>6pm - Late each night.<br>Open to students and the general public alike.<br><br>Ã‚Â£3.50 entry, cash only. <br>Free entry to CAMRA members on Saturday.</p>','https://scontent-hkg3-1.xx.fbcdn.net/v/t1.0-9/15977602_1420948217950346_2811908105753777775_n.jpg?oh=f8681292c32d6ecb345fcea842ea7263&oe=59AC7857',0,'401468610193145',2,'2017-01-12 12:08:09');
